import React from 'react'
import MyAudiocards from './MyAudiocards.js'
import { Grid, Card } from 'semantic-ui-react'


const Home = () => {
    return (
        <div className="home-container">
            <Card.Group itemsPerRow={3}>
                    <MyAudiocards />
            </Card.Group>
        </div>
    )
}

export default Home;
